import React from 'react';

const Navigation = () =>{
  return(
    <nav>
      <ul>
        <li><a href = "/">Home</a></li>
        <li><a href = "/">Courses</a></li>
        <li><a href = "/">Login</a></li>
        <li><a href = "/">Register</a></li>
      </ul>
    </nav>
  );
};

export default Navigation;
